import React from 'react';
import { Box, Stack, Typography } from '@mui/material';
import CropLandscapeIcon from '@mui/icons-material/CropLandscape';

function SignIN(props) {
    return (
        <div>
            <Box width="40%"  sx={{border:"1px solid",margin:"auto",marginTop:"150px",height:"40vh"}}>
                <Stack container>
                
                <Box sx={{textAlign:"center"}}>
                      <CropLandscapeIcon/>
                </Box>
                <Box>
                  <Typography variant="h5" align='center' >Log in to Dashboard</Typography>
                </Box>
                    </Stack> 
            </Box>
        </div>
    );      
}

export default SignIN;
